and destination, including both sides' IPs, ports, number of bytes sent, etc, depending on format.\n\nCurrently there are several NetFlow formats out there, most common are _5_, _7_, and the latest format _9_. Each file consists of **header** and **content**. Header includes information about format version, stream version, start capturing time and end capturing time, flow count, vendor identifier, comment, etc. It also has set of flags that define processing, including compression flag. Content consists of fixed size records, for example, for NetFlow v5, record size is 64 bytes, and includes about 2 dozen fields. You can find list of available fields on Cisco website, Wikipedia page or just by searching for a specific format. \n\nOne of the most popular tools to use for reading and writing NetFlow files is [flow-tools](http://linux.die.net/man/1/flow-tools) library, which gives use different commands of interacting with the data, e.g. displaying raw data, filtering data, or creating an aggregated report + generating dummy data.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"startTime":0.0,"submitTime":0.0,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"0b56585e-400c-486e-adec-ac2dcd056564"},{"version":"CommandV1","origId":124380,"guid":"85a5a2ac-ad26-4e4d-9724-311a91568de7","subtype":"command","commandType":"auto","position":3.0,"command":"%md \nIn this notebook we assume that data has been already collected by routers, we will be reading exported files using [spark-netflow](https://spark-packages.org/package/sadikovi/spark-netflow) package, [GitHub link](https://github.com/sadikovi/spark-netflow).\n\n**spark-netflow** package is a datasource for reading NetFlow files in Spark SQL. It currently supports only export version 5 and 7, but other versions can easily be added later. Here we will go through basic usage and features, but I recommend to have a look at [README](https://github.com/sadikovi/spark-netflow#features) in repository for some additional features, that are not mentioned in notebook, e.g. statistics.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"startTime":0.0,"submitTime":0.0,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"91279e3d-b0bd-4377-bdcd-2abee166fa2b"},{"version":"CommandV1","origId":124381,"guid":"c0354e6e-ed75-453e-aa9d-c09f995b84ff","subtype":"command","commandType":"auto","position":3.5,"command":"%md\n## Initial setup (importing files and adding library)","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"startTime":0.0,"submitTime":0.0,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"3caedbe5-3816-4bb9-825f-044ed
